import { React, Component } from 'react';

class ReactReduxConnection extends Component {
    constructor(props) {
        super(props);
        this.state = {}
    }

    render(){
        return (
            <div className="container p-5">
                <h2> ReactReduxConnection Example</h2>
            </div>
        )
    }
}

export default ReactReduxConnection;
